.cardContainer {
    display: flex;
    flex-wrap: wrap;
    justify-content: space-around;
    padding: 20px;
    
  }
  
  .card {
    background: linear-gradient(135deg, #f6d365 0%, #fda085 100%);
    border-radius: 15px;
    box-shadow: 0 4px 15px rgba(0, 0, 0, 0.2);
    margin: 20px;
    width: 250px;
    overflow: hidden;
    transition: transform 0.3s, box-shadow 0.3s;
  
    &:hover {
      transform: scale(1.05);
      box-shadow: 0 6px 20px rgba(0, 0, 0, 0.3);
    }
  }
  
  .cardImage {
    width: 100%;
    height: 200px;
    object-fit: cover;
    border-bottom: 2px solid #fff;
  }
  
  .cardContent {
    padding: 20px;
    text-align: center;
  }
  
  .cardTitle {
    font-size: 1.8em;
    margin: 0;
    color: #fff;
    text-shadow: 1px 1px 2px rgba(0, 0, 0, 0.2);
  }
  
  .cardText {
    font-size: 1em;
    color: #fff;
    margin: 10px 0;
  }
